        var text = null;
        if(echelon === ("A"))
        {
            text = String.fromCharCode(216);//
        }
        else if(echelon === ("B"))
        {
            text = String.fromCharCode(8226);//8226
        }
        else if(echelon === ("C"))
        {
            text = String.fromCharCode(8226,8226);//8226
        }
        else if(echelon === ("D"))
        {
            text = String.fromCharCode(8226,8226,8226);//8226
        }
        else if(echelon === ("E"))
        {
            text = "|";
        }
        else if(echelon === ("F"))
        {
            text = "||";
        }
        else if(echelon === ("G"))
        {
            text = "|||";
        }
        else if(echelon === ("H"))
        {
            text = "X";
        }
        else if(echelon === ("I"))
        {
            text = "XX";
        }
        else if(echelon === ("J"))
        {
            text = "XXX";
        }
        else if(echelon === ("K"))
        {
            text = "XXXX";
        }
        else if(echelon === ("L"))
        {
            text = "XXXXX";
        }
        else if(echelon === ("M"))
        {
            text = "XXXXXX";
        }
        else if(echelon === ("N"))
        {
            text = "++";
        }
        return text;
